%choose camera and adjust
D2_1 = str2double(strsplit(D2_1));
D2_1 = D2_1(45:1800);
D2_2 = str2double(strsplit(D2_2));
D2_2 = D2_2(45:1800);
D2_3 = str2double(strsplit(D2_3));
D2_3 = D2_3(45:1800);
D2_3 = D2_3 - mean(D2_3);
D2_4 = str2double(strsplit(D2_4));
D2_4 = D2_4(45:1800);
D2_4 = D2_4 - mean(D2_4);

% === INPUT SIGNALS: D2_1, D2_2, D2_3, D2_4 must be loaded ===

% Threshold for peak detection
threshold = 4e4;

% === Step 1: Detect peaks in each signal ===
[locs1, pks1] = find_peaks(D2_1, threshold);
[locs2, pks2] = find_peaks(D2_2, threshold);
[locs3, pks3] = find_peaks(D2_3, threshold);
[locs4, pks4] = find_peaks(D2_4, threshold);

% === Step 2: Merge peaks within 5-frame window ===
all_locs = [locs1, locs2, locs3, locs4];
source_ids = [ones(1, numel(locs1)), 2*ones(1, numel(locs2)), ...
              3*ones(1, numel(locs3)), 4*ones(1, numel(locs4))];

[sorted_locs, sort_idx] = sort(all_locs);
sorted_ids = source_ids(sort_idx);

merged_peaks = [];
group = {};

for i = 1:length(sorted_locs)
    if isempty(merged_peaks)
        merged_peaks(end+1) = sorted_locs(i);
        group{end+1} = sorted_locs(i);
    elseif sorted_locs(i) - merged_peaks(end) <= 5
        group{end} = [group{end}, sorted_locs(i)];
        merged_peaks(end) = round(mean(group{end}));
    else
        merged_peaks(end+1) = sorted_locs(i);
        group{end+1} = sorted_locs(i);
    end
end

% === Step 3: Extract intensities at merged peak locations ===
num_peaks = length(merged_peaks);
intensities = zeros(num_peaks, 4);

for i = 1:num_peaks
    frame = merged_peaks(i);
    idx1 = find(abs(locs1 - frame) <= 2, 1); if ~isempty(idx1), intensities(i,1) = pks1(idx1); end
    idx2 = find(abs(locs2 - frame) <= 2, 1); if ~isempty(idx2), intensities(i,2) = pks2(idx2); end
    idx3 = find(abs(locs3 - frame) <= 2, 1); if ~isempty(idx3), intensities(i,3) = pks3(idx3); end
    idx4 = find(abs(locs4 - frame) <= 2, 1); if ~isempty(idx4), intensities(i,4) = pks4(idx4); end
end

% === Step 4: Create and save the table ===
T = table(merged_peaks', intensities(:,1), intensities(:,2), ...
          intensities(:,3), intensities(:,4), ...
          'VariableNames', {'Frame', 'D2_1', 'D2_2', 'D2_3', 'D2_4'});

writetable(T, 'merged_peaks_table.csv');
disp(T);

% === Step 5: Plot each signal with its own peaks only ===
figure;
hold on;
plot(D2_1, 'b'); scatter(locs1, pks1, 50, 'bo', 'filled');
plot(D2_2, 'r'); scatter(locs2, pks2, 50, 'ro', 'filled');
plot(D2_3, 'g'); scatter(locs3, pks3, 50, 'go', 'filled');
plot(D2_4, 'm'); scatter(locs4, pks4, 50, 'mo', 'filled');

legend('D2\_1','Peaks 1','D2\_2','Peaks 2','D2\_3','Peaks 3','D2\_4','Peaks 4', 'Location', 'best');
title('Summed Pixel Intensities and Detected Peaks (Individual Signals)');
xlabel('Frame Number');
ylabel('Intensity');
grid on;
hold off;

% === Helper Function: Find Peaks ===
function [locs, pks] = find_peaks(D, threshold)
    locs = [];
    pks = [];
    for i = 2:length(D)-1
        if D(i) >= D(i-1) && D(i) >= D(i+1) && D(i) > threshold
            locs(end+1) = i;
            pks(end+1) = D(i);
        end
    end
end


